import React, { Component } from "react";
import { Link } from "react-router-dom";
import User from "../Components/User.js";
import Backdrop from "../Components/Backdrop.js";
import UserDrawer from "../Components/UserDrawer.js";
import "../App.css";

class CustomNavbar extends Component {
  state = {
    userDrawerOpen: false
  };

  userDrawerHandler = () => {
    this.setState(prevState => {
      return { userDrawerOpen: !prevState.userDrawerOpen };
    });
  };

  backdropClickHandler = () => {
    this.setState({ userDrawerOpen: false });
  };

  render() {
    let backdrop;
    if (this.state.userDrawerOpen) {
      backdrop = <Backdrop click={this.backdropClickHandler} />;
    }

    return (
      <div>
      <div className="modal" id="signInModal" data-backdrop="false">
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h3 className="text-center text-primary centerMe"> Enter Class Numbers </h3>
              <button type="button" className="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button>
            </div>
            <div className="modal-body">
              <form>
                <div className="row">
                  <div className="col">
                    <input type="text" className="form-control" placeholder="Class 1"/><br/>
                    <input type="text" className="form-control" placeholder="Class 2"/><br/>
                    <input type="text" className="form-control" placeholder="Class 3"/><br/>
                  </div>
                  <div className="col">
                    <input type="text" className="form-control" placeholder="Class 4"/><br/>
                    <input type="text" className="form-control" placeholder="Class 5"/><br/>
                    <input type="text" className="form-control" placeholder="Class 6"/><br/>
                  </div>
                </div>
                <button type="submit">Save</button>
              </form>
            </div>
          </div>
        </div>
      </div>
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary Shadow">
        <div className="container-fluid">
          <div className="navbar-header">
            <Link to="/" className="noTextDecoration">
              <h1 style={{ color: "#FFFFFF", fontSize: 30 }}>CSUN Hub</h1>
            </Link>
          </div>
          <div className="spacer" />
          <div>
            <a data-target="#mymodal" data-toggle="modal"> Sign In </a>
          </div>
        </div>
      </nav>
      </div>
    );
  }
}

export default CustomNavbar;
